  //····················································································································

  override func appendPropertyNamesTo (_ ioString : inout String) {
    super.appendPropertyNamesTo (&ioString)
  //--- Atomic properties
    ioString += "mX\n"
    ioString += "mY\n"
    ioString += "mCPX1\n"
    ioString += "mCPY1\n"
    ioString += "mCPX2\n"
    ioString += "mCPY2\n"
    ioString += "mShape\n"
